import React from 'react';
import style from './App.module.css';
import TopScreen from "./Components/TopScreen/TopScreen";
import Frame from "./Components/Frame/Frame";
import Footer from "./Components/Footer/Footer";
import '@vkontakte/vkui/dist/fonts.css';
import Example from "./Components/EpicBlock/EpicBlock";
import {AdaptivityProvider, AppRoot, ConfigProvider, SplitCol, SplitLayout} from "@vkontakte/vkui";
import Navigator from "./Components/Navigator/Navigator";
import MainScreens from "./Components/MainScreens/MainScreens";

//
function App({ viewWidth }) {
    return (
        <ConfigProvider>
            <AdaptivityProvider>
                <AppRoot>
                    <SplitLayout>
                        <SplitCol width={280}>
                            <Navigator/>
                        </SplitCol>
                        <SplitCol>
                            <MainScreens/>
                        </SplitCol>

                    </SplitLayout>
                </AppRoot>
            </AdaptivityProvider>
        </ConfigProvider>

            );
}

export default App;
